    false,nt"url": null,nt"notes": "This narrative report for Charles M. Russell
    outlines Refuge accomplishments from September to December of 1963. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during the period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    grazing and fur harvesting. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    physical developments and Refuge visitors. Attachments include items of interest
    and photographs.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
